INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (1, 0, 0, 11, "やった！　これにて完成でござるよ～！\nう～ん、色使いといい、タッチといい、\n今度も素晴らしい出来栄えですな～！", 101311, 14112, 10, 0.5, 1, 14112025);
