INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (1, 0, 0, 11, "あら？　でも……\n片づけはもう済んでるみたいよ？\nうふふ、いったいどこの「いい子」が\nやってくれたのかしらね～？", 105111, 14112, 10, 0.5, 1, 14112035);
