INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (1, 0, 0, 11, "クスクス……私は見ていましたよ。\nアンナさん、あなたがいそいそと\n後ろで道具を片づけているのを……", 102711, 14112, 10, 0.5, 1, 14112040);
