INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (1, 0, 0, 11, "シュバババババ～♪\n忍法に不可能はありまセン！\nウキヨエを壁に描くのも\nお手の物デス！", 103011, 19812, 10, 0.5, 1, 19812029);
