INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (1, 0, 0, 11, "美を伝えるという点では同じだよ。\nボクだって歯磨きをするボクや\nお昼ご飯を食べるボクがいるけど、\n全て美しいボクには違いないでしょ？", 100811, 19812, 10, 0.5, 1, 19812039);
