INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (1, 0, 0, 11, "はぁ、思わずため息が出るよ。\nかわいいボクが、美しい絵を描く。\nただそれだけで、言葉にできないほど\n尊い場面になってしまうよね？", 100811, 23812, 10, 0.5, 1, 23812026);
