INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (1, 0, 0, 11, "う～ん……飲み過ぎたかしら……？\n頭が痛くて、集中できないわ～……\nアキノさん、私の担当部分、\nちゃんとできてるかしら？", 103411, 39512, 10, 0.5, 1, 39512022);
