INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (1, 0, 0, 11, "どれどれ……問題ありませんわ。\nただ、麦しゅわはちゃんと量を\n考えてたしなむべきです。\nそのうち体を壊しますわよ？", 103211, 39512, 10, 0.5, 1, 39512027);
